INSERT INTO `capitulo` VALUES (1,'Rusia perdiendo, Nazis en Ucrania','Especial Guerra Ucrania y Rusia con el experto en geopolítica Borja Fernández, líder del canal de Youtube Memorias de Pez. Borja explicará cómo está la situación a día de hoy, con una Rusia estancada y sancionada, lo que significa el temible Batallón Azov para el gobierno ucraniano, si las reivindicaciones de Putin tienen sentido, hará un perfil de Zelensky, analizará la posibilidad de una Tercera Guerra Mundial atómica, avanzará posibles escenarios finales... y mucho más. ¡No te lo pierdas!',200,'2022-03-24',100,1),(2,'Xokas y sus cuentas, Willyrex full attack a Grefg: Fin de semana loco','Como cada semana, tertulia en The Wild Project con las noticias más interesantes de los últimos días. En esta ocasión, buena parte de la charla tendrá que ver con el loco fin de semana en el cuál la polémica con Xokas y sus multicuentas (y los problemas reales de toxicidad y salud mental asociados) y el inesperado ataque de Willyrex a TheGrefg han copado la atención de todos. Pero también habrá tiempo para hablar de la importante huelga de transportistas, El hombre indio que busca esposa de manera loca, Elon Musk sigue con los combates con Putin, Influencers llorando... Y mucho más. ¡No te lo pierdas!',210,'2022-03-22',100,1),(3,'Se fugó de una secta a los 16 pero su familia sigue encerrada','Uno de los podcasts más duros hasta el momento, sin duda. Pablo Salum, que pasó buena parte de su vida metido en una asquerosa secta y que consiguió escaparse hace unos años, visita a Jordi Wild para charlar de su propia experiencia, en un dificilísimo periplo que termina con él fugándose, pero dejando atrás a su madre y hermanos. Ellos, más de una década después, siguen ahí dentro... Además, charlarán de las sectas modernas, grupos coercitivos, religiones, polémicas con famosos manipuladores y mucho más. ¡No te lo pierdas!',220,'2022-03-18',100,1),(4,'Combate Elon Musk VS Vladimir Putin, Xokas funado again, Nimu','Nueva tertulia en The Wild Project con las noticias más interesantes de los últimos días. En este episodio: Una pareja de youtubers americanos pueden ir 7 años a la cárcel por la tontería que hicieron en su último vídeo, Rubius está más de una semana en un extensible y consigue un dineral para los animales, Sigue la invasión de Ucrania por parte de Rusia, Elon Musk reta a Putin a un combate para solucionarlo todo, Bruce Willis ha hecho 18 películas en 2 años, Jordi Wild es sorprendido con un regalazo... y mucho más. ¡No te lo pierdas!',240,'2022-03-15',100,1),(5,'Arturo Pérez-Reverte, Lenguaje inclusivo, Su vida como reportero de guerra','Arturo Pérez-Reverte, uno de los escritores más importantes y best-sellers del mundo, reportero de guerra durante 21 años, y miembro de la Real Academia Española, visita The Wild Project para una de las charlas más esperadas y, seguramente, sorpresivas. Junto a Jordi Wild, Arturo reflexionara sobre la guerra, la miseria humana, pero también sobre su proceso como escritor, sin rehuir temas de candente actualidad como Ucrania o la moda del lenguaje inclusivo. ¡No te lo pierdas!',165,'2022-03-10',100,1),(6,'Famosas por ser guapas con Ingrid García-Jonsson','En este programa especial grabado desde el Festival de Málaga, hablamos con Ingrid García-Jonsson de ser famosas, con sus cosas malas y sus cosas buenas, principalmente los canapés. Además, a Henar Álvarez le hacen una curita de humildad en la alfombra roja y nos enseña a mear de pie en vivo y en directo.',69,'2022-02-24',100,2),(7,'Tocarse la pepa con Zahara','Una de las invitadas más pedidas ya está aquí: Zahara. La cantante ha compartido vivencias y anécdotas sobre su sexualidad y cómo todas esas experiencias le han hecho ser quien es hoy. Nani no podía faltar en este programa y acaba desnudándose.',70,'2022-03-25',100,2),(8,'Salto al potro y sentadillas con Susana Rodríguez','Ganadoras de un Ondas comparten espacio con ganadora de medalla de oro olímpica: sólo triunfos en este podcast. Susana Rodríguez Gacio, triatleta y médica, habla sobre superación, deporte y consigue que Carol haga la primera sentadilla de su vida. Lala Chus nos pone blanditas hablando sobre sus padres y sobre la importancia de los cuidados.',65,'2022-03-18',100,2),(9,'Ser frikis con Edurne','Esta semana hablamos de ser frikis, de ser fans y de coleccionar movidas con la cantante Edurne, posiblemente la persona más maja del mundo. Carol y Vicky también cuentan sus obsesiones de cuando eran pequeñas (y no tan pequeñas) y se viene Lala Chus para contar cómo Pasión de Gavilanes le salvó literalmente la vida.',76,'2022-03-24',100,2),(10,'Vivir o morir con Sofía Cristo','En este nuevo programa, hablamos de adicciones, del mundo de la noche y de cómo pedir ayuda con Sofía Cristo, una de las mejores DJ de España. Hay sección de Patricia Espejo que, como ella dice, es de Valencia y de esto sabe un poco. ',60,'2022-03-24',100,2),(11,'Las plantas con Miguel Maldonado','Miguel Maldonado está dentrísimo de las plantas, tanto que una es su abuela. Tanto que el de coleta de Bricomanía es su faro. Tanto que recuerda la pata de elefante que ha matado como un soldado retornado de Vietnam con la mirada de las mil yardas. Manuel Burque habla con él y el de coleta de Bricomanía y varios dueños de viveros hablan con vosotros para que también estéis dentrísimo del tema.',30,'2022-03-17',100,3),(12,'Angry','Ángel Martín y Angy charlan sin ningún tipo de filtro acerca de su experiencia con la salud mental y de los peligros de priorizar la aceptación a ojos de otro en lugar de a los nuestros.',71,'2022-03-24',100,4),(13,'Jero García','Ángel Martín y Jero Garcia charlan sin ningún tipo de filtro acerca de su experiencia con la salud mental, el trastorno por deficit de atención e hiperactividad y de cómo el deporte se convirtió en la herramientas más importantes para mantenerse a flote.',59,'2022-03-17',100,4),(14,'Ambkor','Ángel Martín y Oscar (Ambkor) charlan sin ningún tipo de filtro acerca de su experiencia con la salud mental.',70,'2022-03-10',100,4),(15,'Chica Sobresalto','Ángel Martín y Maialen (Chica Sobresalto) charlan sin ningún tipo de filtro acerca de su experiencia con la salud mental y de cómo enfrentarse a la agorafobia. ',77,'2022-03-03',100,4),(16,'Diego Arroyo (Veintiuno)','Ángel Martín y Diego Arroyo charlan sin ningún tipo de filtro acerca de su experiencia con la salud mental y de cómo mantener la estabilidad cuando te diagnostican trastorno ansioso - depresivo.',56,'2022-02-24',100,4),(17,'Nuestros primeros realities con Inés Hernand','¿Hay algo más milenial que un reality! Invitamos a Inés Hernand para hablar del impacto de esa nueva televisión en nuestra vida. De OT y Gran Hermano a Vale Music o Portalmix, de Supermodelo y El Bus a Popstars y Fama... Todo por el sueño de recordar un sinfín de nombres (Ismael Beiro, Rosa de España, Sergio Alcover...) que, por algún motivo, siguen en nuestra memoria. Cierra sesión en el Tuenti y vente a nuestro Cuarto Milenial, que empieza…la vida en directo ;)',45,'2022-03-23',100,5),(18,'Free Britney y otras divas con Jedet','¡Bienvenidas a nuestro cuarto milenial! Invitamos a Jedet para hablar de la reina, la primera, la que lo desencadenó todo para nosotras: Brtiney Spears. Hablamos de ella, del #FreeBritney y del resto de divas del final de los 90 y los 2000 y jugamos a los test de revista con nuestra madrina. Curiosidades e historias de carpeta forrada para el estreno;)',45,'2022-03-09',100,5),(19,'Informativo matinal 2022-03-28','Las noticias de hoy 2022-03-28',2,'2022-03-28',100,6),(20,'Informativo matinal 2022-03-25','Las noticias de hoy 2022-03-25',2,'2022-03-25',100,6),(21,'Informativo matinal 2022-03-24','Las noticias de hoy 2022-03-24',2,'2022-03-24',100,6),(22,'Informativo matinal 2022-03-22','Las noticias de hoy 2022-03-22',2,'2022-03-22',100,6),(23,'Informativo matinal 2022-03-21','Las noticias de hoy 2022-03-21',2,'2022-03-21',100,6),(24,'Ser demasiado racional','Cuántas veces nos habremos enfrentado a una de esas batallas en las que no tenemos claro si queremos luchar por que gane nuestra cabeza o nuestro corazón… Porque esa es la eterna pregunta: ¿a cuál de los dos tenemos que hacer más caso? ¿Qué es mejor, ser una persona emocional o ser una persona racional?',17,'2022-03-16',100,7),(25,'Gestionar la tristeza al terminar una relación','No es la primera vez que decimos que no es fácil poner fin a una relación de pareja. Los buenos momentos, las costumbres compartidas, los recuerdos… Pueden hacer que sintamos que es imposible salir de esa sensación de tristeza -seamos o no la persona que ha tomado la decisión- o que perdamos la esperanza de recuperar la ilusión en un futuro.',21,'2022-03-09',100,7),(27,'Mantener la calma en objetivos a largo plazo','Hay ocasiones en las que el largo plazo parece una especie de abismo al que jamás podemos llegar del todo… O, al menos, no con la ilusión y la tranquilidad con la que comenzamos a recorrerlo. Esta es la sensación de la amiga que nos propone el tema de hoy: ¿se puede mantener la calma a sabiendas de que los frutos del esfuerzo invertido tardarán en llegar? ¿Cómo podemos trabajar esa paciencia que se necesita en los proyectos y metas a largo plazo?',17,'2022-03-02',100,7),(28,'Aceptar decisiones de los demás','Nuestro entorno -las personas con las que nos relacionamos, los grupos sociales a los que pertenecemos, etc.- nos afecta de una manera u otra. Es lo que implica vivir en sociedad: que, muchas veces, nuestras decisiones afectan a otras personas y lo que los demás hacen acaba por afectarnos también a nosotros.',21,'2022-02-23',100,7),(29,'¿Es bueno planificar?','¿Perteneces a ese grupo de personas que tiende a planificar sus rutinas y su día a día? ¿O te consideras más de esos que deja libertad a la improvisación? Seas como seas y tal y como sucede en todos los ámbitos de la vida, lo ideal sería encontrar un equilibrio entre la organización y la espontaneidad, pero ¿cómo podemos hacerlo?',19,'2022-02-16',100,7),(30,'Una entrega muy boba','En este \'Nadie Sabe Nada\' se hace realidad la promesa de Andreu Buenafuente con el regalo inesperado de Berto Romero: se viste con el disfraz de niño de Boba Fit. La imagen quedará para los anales de la historia del programa y también en nuestras mentes. Una vez superado este trance psicodélico, el programa vuelve más o menos a la normalidad: preguntas, respuestas, secciones... y la irrupción de Sílvia Abril de \'Las del Grupo\' en el Estudio Toresky como si estuviera en su casa.',22,'2022-03-26',100,8),(31,'Onironautas y Onironautas, tan lejos, tan cerca','Pocas veces se produce esta situación: Berto Romero hace un regalo a Andreu Buenafuente. Lo malo de este \'Nadie Sabe Nada\' es que no veremos el resultado final de ese regalo hasta el siguiente programa. También seremos testigos de unas conversaciones sobre sueños, de las cosas que puede llegar a hacer un Tesla y el regreso del \'groove doméstico\', en esta ocasión adaptado a un cementerio.',53,'2022-03-19',100,8),(32,'La simulación del disimulo con Sterling y Joaquín','Un \'Nadie Sabe Nada\' que empieza con el ronroneo de Andreu Buenafuente, Berto Romero y las personas cárnicas de cuerpo presente en el estudio Toresky de La SER en Barcelona solo puede acabar con una situación surrealista: la escenificación del disimulo por el rey de esta práctica: Sterling. Mientras, Joaquín, tiene que soportar ser ignorado. Hay más cosas pero es mejor escucharlo o verlo. Las dos cosas son compatibles.',53,'2022-03-12',100,8),(33,'Correr desnudo tras un queso por una pendiente','Noticia: Andreu Buenafuente llega tarde. Bueno... no es noticia, es habitual. En este \'Nadie Sabe Nada\' se habla mucho de series, del universo \'Star Wars\' y el parecido de R2D2 con una papelera. El colofón lo pone Berto Romero descubriéndole a Andreu una función que no sabía de sus auriculares.',54,'2022-03-05',100,8),(34,'No nos duelen prendas hablar de la Edad Media','La relación de Andreu Buenafuente con el café es muy curiosa: cuando no le da subidón, se lo tira por encima. Y su relación con Sílvia Abril está siendo triste porque ella trabaja tanto que él la echa mucho de menos. Cuando la vea de nuevo le dará subidó y se la tirará por encima, seguro. Berto Romero hace un chiste malísimo y esto es para marcar en el calendario, descubre que podría dormir con una almohada de embarazada porque se siente mayor y pierde el apadrinamiento del programa de radio de Eva Soriano. Mal día para Berto en \'Nadie Sabe Nada\'.',53,'2022-02-26',100,8),(35,'Jordi Évole','Jordi Évole llamó a su productora Producciones del Barrio como una declaración de intenciones. Hace periodismo de altura con mucha calle, se codea con lo más alto haciéndoles bajar adonde la gente los necesita. Para saber más del hombre que cambió el periodismo de prime time hay que ir a Cornellá. Al asfalto donde se gestó el Follonero que asaltó los cielos.',47,'2022-03-24',100,9),(36,'No somos tan buenas','Hoy nos salimos por primera vez del papel de víctima para hablar de cuando nosotros hemos sido unas personas de mierda, de lo muchísimo que nos gusta discutir con hombres cuando sabemos que tenemos la razón, y sobre todo hablamos de Carrie Bradshaw.',66,'2022-03-27',100,10),(37,'Un cinco con 6 créditos','Hoy dos personas que no han ido a clase desde el día en el que se matricularon hablan de la universidad, de cómo empezaron siendo niños prodigio y al final el prodigio terminó siendo que tuvieran un mínimo ápice de motivación. Síguenos en @pijayquinqui.',67,'2022-03-20',100,10),(38,'La contrarreforma sexual','Bienvenidas un domingo más, chicas y gays. Esta semana hablamos del período más oscuro de nuestra historia reciente: la revolución sexual, las mentiras que nos vendieron como empoderantes y cómo nos han jodido un poquito la cabeza.',67,'2022-03-13',100,10),(39,'No quiero superarlo','En este episodio de La Pija y la Quinqui de emergencia hablamos de lo mismo de siempre: el amor romántico y la monogamia. O más bien, sus consecuencias. Hablamos de Taylor Swift y de Paz Padilla: cómo nos han dejado cucú y cómo se supone que tenemos que perdonar a estas personas que nos han dejado cucú, el porqué no queremos \'superar\' estas cosas y la presión de la gente para que lo hagas.',63,'2022-03-06',100,10),(40,'La zona sin comfort','Hoy hablamos de los criminales de guerra que pronuncian la frase \'tienes que salir de tu zona de comfort\', de nunca estar cómodos y de las cosas que son nuestro lugar seguro. Perdón por la intensidad.',66,'2022-02-27',100,10),(41,'Bofetón de Oscar','La agresión de Will Smith al cómico Chris Rock sobre el escenario empaña la noche de \'CODA\' y el español Alberto Mielgo.',5,'2022-03-28',100,11),(42,'De acuerdo','Los transportistas cierran un trato con el Gobierno, los países de la OTAN pactan una nueva estrategia de defensa y Estados Unidos y la UE acuerdan un nuevo plan para traer gas a Europa.',4,'2022-03-25',100,11),(43,'Un mes después','La OTAN anuncia el refuerzo de su flanco oriental cuando se cumplen cuatro semanas de la invasión rusa de Ucrania.',5,'2022-03-24',100,11),(44,'Frenazo','Las grandes empresas de alimentación y la industria pesada advierten de que su producción peligra si el paro del transporte sigue adelante.',5,'2022-03-23',100,11),(45,'No hay trato','El Gobierno ofrece 500 millones de ayudas directas a los camioneros, que rechazan la propuesta porque le falta concreción.',5,'2022-03-22',100,11),(46,'Levántate OK con Javier Cárdenas','Te contamos como el Gobierno ha tratado de engañar a los camioneros.',97,'2022-03-28',100,12),(47,'Levántate OK con Javier Cárdenas','La Unión Europea se cachondea de España por tener a un Ministro de Cultura y otra de Educación sin titulación universitaria...',85,'2022-03-25',100,12),(48,'Levántate OK con Javier Cárdenas','Pedro Sánchez se inventa un nuevo cargo para un amigo como embajador del COVID, pagado con nuestros impuestos.',86,'2022-03-24',100,12),(49,'Levántate OK con Javier Cárdenas','El PSOE de Huelva nos roba a todos mientras aseguran que la derecha tiene la corrupción en su ADN...',84,'2022-03-23',100,12),(50,'Levántate OK con Javier Cárdenas','¿Imaginas una película de ficción en la que el regalo del Sahara acabara en la cuenta bancaria de Pedro Sánchez?',93,'2022-03-22',100,12),(51,'¿Debe la tolerancia tolerar la intolerancia?','Ada Colau, alcaldesa de Barcelona y Samantha Hudson icono centenial y artista, conversan con Isaac Marcet, Director de PlayGround, sobre la calidad de nuestra democracia.',55,'2022-03-23',100,13),(52,'¿Está la democracia en extinción?','¿Somos conscientes de lo que estamos trasladando a los más jóvenes que escuchan los debates parlamentarios?',46,'2022-03-21',100,13),(53,'¿Sabes estar sol@?','En este episodio os hablo de la importancia de saber estar solo, ser independiente y no temerle a los fines de semana \'sin plan\'. Disfrutar de tiempo con uno mismo es fundamental.',24,'2022-03-21',100,13),(54,'Relaciones sanas: sí, es posible','En este episodio os cuento (a través de mi experiencia) como sí es posible tener una relación sana a pesar de haber tenido un pasado un poco más tóxico.',28,'2022-03-21',100,14),(55,'Deja de compararte con los demás','En este episodio os comparto cómo compararte con los demás destroza totalmente tu autoestima y tu salud mental, y cómo la mayor parte de cosas con las que nos comparamos ni siquiera son reales, todo es cuestión de perspectiva :)',25,'2022-03-21',100,14),(56,'¿Porqué no soy feliz?','En este episodio os invito a reflexionar sobre la felicidad, qué es lo que significa para mí y los motivos por los que podemos no ser felices!',36,'2022-03-21',100,14),(57,'La enfermiza obsesión con el físico','En este episodio os hablo de mi experiencia con los complejos físicos y la obsesión por el físico y comer saludable, así como mi opinión sobre cómo las redes sociales y los cánones de belleza afectan en este aspecto.',41,'2022-03-21',100,14),(58,'BOTOXMAMI','Hablamos de cirugía estética, de las imposiciones en los cánones de belleza y de esas cosillas de nuestro cuerpo que nos acomplejan. Nerea Pérez de las Heras e Inés Hernand, además, te explican el conflicto en el Sáhara y analizan el nuevo disco de Rosalía. ',55,'2022-03-23',100,15),(59,'TERRORISMO','Inés Hernand y Nerea Pérez de las Heras hablan de terrorismo con Carola García Clavo, investigadora principal del Instituto Elcano, y que explica qué se considera terrorismo, repasa los datos, las cifras y las listas de grupos que siguen en activo. Además, repasamos la última hora en la guerra de Ucrania y la entrada de la ultraderecha en un gobierno en España. ',48,'2022-03-16',100,15),(60,'SALDREMOS, MUJERES','Hablamos de feminismo, como no podía ser de otra forma, por el Día Internacional de la Mujer. Nerea Pérez de las Heras e Inés Hernand hacen una radiografía a un mundo hecho para los hombres: desde el diseño de las ciudades hasta el de los móviles, pasando por los ensayos clínicos o los sistemas de reconocimiento de voz.',58,'2022-03-08',100,15),(61,'SEÑORES MADUROS BUSCAN GUERRA','Esta semana hay poca risa: analizamos el conflicto de Rusia y Ucrania. Contamos con la ayuda del politólogo Alán Barroso y de la periodista ucraniana Margaryta Yakovenko, que nos explican cómo surge, qué consecuencias puede tener esta guerra y qué se espera en las próximas semanas.',55,'2022-03-02',100,15),(62,'SUSPENSO EN SEXO','¿Sabes cómo se transmite la clamidia? ¿Y qué te dice el color de tu flujo? El sexo no es un tabú que solo existe a puerta cerrada sino una parte de la vida inseparable de nuestra salud física o emocional, nuestra identidad y nuestra manera de relacionarnos con los demás. España es uno de los pocos países europeos que no imparte esta materia en sus aulas de manera oficial. Hablamos de fornicio pero también -y sobre todo- de relaciones sociales, desarrollo personal, pin parental y consumo de porno salvaje.  ¿Cuánto sabemos realmente de educación sexual?',54,'2022-02-23',100,15),(63,'La seducción','Hoy abrimos el melón más importante, el de la atracción y la conquista y los métodos necesarios para conseguirla. Hablamos de tácticas execrables para seducir, los buenos y malos seductores, y el increíble fenómeno del enamoramiento postcoital. Hablamos de la triangulación, la indiferencia y el \'neg\', no te pierdas este episodio porque es fundamental para tu vida.',81,'2022-03-20',100,16),(64,'Brujas','Hoy hablamos de las mujeres acusadas de brujería, de pactar con el diablo, de por qué usan escoba y tienen gato. Hablamos de brujas contemporáneas y de la historia del feminicidio que fueron las cazas de brujas. De Ambrose Bierce, Silvia Federicci, antisemitismo, la misoginia en los hombres de izquierda y de por qué, por qué, por qué, el amor es siempre un trabajo. No te lo pierdas.',73,'2022-03-06',100,16),(65,'La envidia','En este episodio hablamos del pecado universal más inconfesable y el más común. Relatamos todas las envidias a las que nos vemos sometidas y volvemos la vista atrás: la envidia y las mejores amigas, los celos como motor de escurrir el bulto, las mujeres que envidian, Dora Maar y los novios envidiosos. ¡No te lo pierdas!',85,'2022-02-20',100,16),(66,'La mentira','Hoy hablamos del acto utilizado por las personas para fingir, engañar, aparentar, persuadir o evitar situaciones. De mentir por neurosis, de relaciones abiertas, de mentir por amor sin parar. Pero también de Michelle Obama, el autoengaño de querer un sofá que no parezca un sofá y de salir con gente más guapa que tú. Miente, concursanta, que algo queda.',89,'2022-02-06',100,16),(67,'La juventud','Hoy hablamos del tránsito de la infancia a la edad adulta, ese tramo que mucha gente añora o no soporta perder. Tratamos la juventud de bell hooks y su búsqueda del amor, de las sitcoms familiares y el amor en la niñez. Pero también hablamos de la juventud en su dimensión menos idílica: la búsqueda insaciable de juventud como placer erótico que nunca se calma en Annie Ernaux, de por qué Boris Johnson es un auténtico cretino y de que hay demasiada gente haciéndose la joven que no lo es.',69,'2022-01-23',100,16),(68,'Episodio 0','Club 113 es una realidad y el capítulo 0 un homenaje a nuestros fans. Bienvenidos al Club 113.',110,'2022-03-02',100,17),(69,'Episodio 1 feat. Lunay','Primer-segundo episodio de Club 113, esta vez con Lunay como invitado. Coged sitio, bienvenidos a Club 113. ',87,'2022-03-09',100,17),(70,'Episodio 2 feat. El pequeño Nicolás','Bienvenidos a esta joya del entretenimiento. Disfrutad de Francisco Nicolás a.k.a. Pequeño Nilcolás. ',118,'2022-03-16',100,17),(71,'Episodio 3','La noche de las anécdotas y los trapos sucios. Coged sitio. Bienvenidos a Club 113.',90,'2022-03-23',100,17),(72,'#1 Bolleras','¿De dónde venimos, a dónde vamos, dónde estamos las lesbianas? Invisibilidad, silencio, tópicos, preguntas incómodas y mucho \'bollodrama\'.',66,'2022-02-03',100,18),(73,'#2 Salir del armario','Salir del armario es un derecho, un privilegio, una necesidad. Pero no siempre es fácil ni tampoco posible. Hacerse visible como lesbiana (todavía hoy) puede ser un ejercicio de valentía liberador, pero también resultar traumático. Mentiras, secretos, dudas, miedos y mucho \'bollodrama\'.',46,'2022-02-15',100,18),(74,'#3 Clase de sexo lésbico para heteros','Y vosotras, ¿cómo lo hacéis? Las lesbianas estamos hartas de esta pregunta... y de muchas más cosas que sufrimos por culpa de la ignorancia sobre la realidad del cuerpo y la mente de las mujeres en general. Esta es la guía definitiva para explicar cómo la psiquiatría y el porno han impulsado el comportamiento misógino de la sociedad hacia nosotras. Sigmund Freud... maldito seas.',44,'2022-02-28',100,18),(75,'#4 Especial 8M','¿Debemos las lesbianas ser feministas? Obviamente sí. Pero... ¿qué es el feminismo? En este especial 8M hablamos de ser mujeres, de ser bolleras, de la violencia patriarcal, institucional, médica, física, verbal, sexual e histórica que sufrimos. La que compartimos y contra la que luchamos cada día como hermanas.',54,'2022-03-08',100,18),(76,'#5 Función lésbica','Hablemos de fantasía y de imaginación. De libertad y deseo. De empotradoras y de roles, pero también de consentimiento y respeto. Del crush con Cate Blanchet, el hype con Malú y el efecto Henar Álvarez. Hablemos... de fantasías lésbicas.',52,'2022-03-22',100,18),(77,'Cinta 01: Familia & parroquia','Los susodichos hablan principalmente sobre la familia, aunque mantienen conversaciones dispersas y un discurso en ocasiones difícil de comprender. Don Julián, el dueño del bar, muestra una libreta de notas. Sería interesante investigar. A la espera de nuevas órdenes, me mantengo a la escucha.',31,'2021-06-04',100,19),(78,'Cinta 02: Deportistas & camareros','El degoteo de grabaciones en \'El Bar de los Broder Tolquin\' sigue trayéndonos conversaciones sobre temas diversos pero con poca relavancia para la investigación. Javier Coronas trabajó en unos almacenes de deportes vendiendo raquetas de tenis y \'esquises\' provocando más de una lesión. Raúl Cimas tiene fijación por clasificar a los camareros. Mientras que Julio, Julián y el Pirata viven en sus mundos.',31,'2021-06-18',100,19),(79,'Cinta 03: Marineros & soñadores','El sentido de la responsabilidad es lo que llevaba a los investigadores del caso del marido de Pili a no tirar la toalla y seguir con las escuchas. Las conversaciones seguían sin revelar nada importante: viajes de fin de curso a Camprodón, resolviendo crucigramas entre todos los del bar, baños en el mar, conciertos sin público, cálculos absurdos sobre el tiempo... O Raúl Cimas, Javier Coronas, Julio, Julián y el Pirata no sabían nada o eran tan listos que hablaban en clave para no ser descubiertos.',26,'2021-07-02',100,19),(80,'Cinta 04: Caminantes & superheroes','El equipo de investigación del caso \'El Bar de los Broder Tolquin\' empieza a ver que se está tramando algo oscuro en ese tugurio. Cuando Raúl Cimas y Javier Coronas hablan de \'andar para atrás\' se cree que hacen una referencia inequívoca a una huida, aunque aún no se sabe de qué, o cuando hacen referencia a hablar con los dientes apretados aluden a tapar bocas, cerrar picos, silenciar topos y chivatos.',26,'2021-07-16',100,19),(81,'Cinta 05: Playback & gorrinos','Tenemos respuestas a preguntas como ¿Brian May es un rácano? ¿El playback nace por pereza de la televisión? o ¿Quién fue el primer candidato para componer la banda sonora de Matrix? Pero no sirven para la investigación del marido de Pili, alias el Cabezón. Sí que descubrimos dónde se reunía la banda de Raúl Cimas y los primeros hurtos de Javier Coronas. Las grabaciones empiezan a dar sus frutos. Lo celebramos con tres \'dry martini\'.',26,'2022-07-30',100,19),(82,'Nuestros viajes raros 3x18','Hacemos un repaso a los viajes de nuestra vida. Además, reservadmos el viaje a Turín para ver Eurovisión desde allí (o lo intentamos).',40,'2022-02-24',100,20),(83,'Declaraciones de amor 3x19','Todos los crushes que han ocupado nuestros corazones. Y contactamos en directo con ellos para declararnos!',44,'2022-03-03',100,20),(84,'Musas y divas 3x20','Dedicamos este programa a todas las divas que no dan la vida. Belén Esteban, La Veneno, Laura Pausini... ¡y salimos a la calle! Nuestra primera dragalada.',43,'2022-03-10',100,20),(85,'Mentiras 3x21','Primer \'Reyes del palique Deluxe\', versión nocturna. Hablamos de nuestras excusas recurridas y mentiras más grandes. Quedamos fatal, pero es lo que hay...',40,'2022-03-17',100,20),(86,'Fin de una etapa 3x22','Hablamos de despedidas y los emocionantes finales de etapa que hemos vivido.',45,'2022-02-24',100,20);
