INSERT INTO `podcast` VALUES (1,'The Wild Project',NULL,'Actualidad, deportes, charlas con los invitados más interesantes, ciencia, anécdotas y curiosidades, debates, filosofía, psicología, misterio, terror... y muchísimo más. Cada semana hablando claro y sin miedo sobre el mundo que nos rodea.','2020-01-01 00:00:00'),(2,'Estirando el chicle',NULL,'Presentado por Carolina Iglesias y Victoria Martín','2020-01-01 00:00:00'),(3,'Dentrísimo',NULL,'Café, plantas, comida picante, buceo, cómics, limpieza… Manuel Burque charla con famosos sobre sus pasiones ocultas y analiza hasta qué punto están locos por ellas. Dentrísimo es un podcast sobre obsesiones, contado de forma obsesiva.','2018-01-01 00:00:00'),(4,'Por si las voces vuelven',NULL,'Ángel Martín charla con personajes populares acerca de sus problemas con la salud mental y de cómo se enfrentan o enfrentaron a ellos para poder seguir adelante.','2021-01-01 00:00:00'),(5,'Cuarto milenial',NULL,'Andrea Compton y Lalachus abren micro desde su Cuarto Milenial. Con invitadas de fantasía, esta habitación sonora (¡que se puede ver, solo en Spotify!) te transportará a tu infancia y adolescencia a través de música, pelis, revistas, juegos…','2017-01-01 00:00:00'),(6,'Informativo matinal express',NULL,'Un informativo matinal diario pensado para que ahorres tiempo y puedas ponerte cuanto antes a hacer cosas','2018-01-01 00:00:00'),(7,'Entiende tu mente',NULL,'Seguro que a lo largo del día tienes 20 minutos. Piénsalo. Puede que sea en ese trayecto que haces en transporte público, en tu coche o paseando. Tal vez mientras cocinas o antes de ir a dormir. Elige el momento y nosotros te prometemos ayudarte a entenderTE y entenderLES mejor.','2019-01-01 00:00:00'),(8,'Nadie Sabe nada',NULL,'Andreu Buenafuente y Berto Romero se sientan frente a frente, micro a micro, e improvisan. ¿Qué puede salir mal? El humor de estos dos genios es oro para tus orejas. Ábrelas bien que, en el fondo, nadie sabe nada.','2018-01-01 00:00:00'),(9,'Dile que baje',NULL,'Para conocer a la gente que creemos conocer, o para saber por qué son cómo son, hay que acudir a la infancia. Al barrio. Al pueblo. Al lugar y el tiempo donde comenzó todo. Quique Peinado, que cree que la patria son los barrios, hablará con calma con gente que llegó lejos empezando de muy abajo. Una charla sobre orígenes que arranca, como todo en la infancia, con un timbrazo al telefonillo y una petición a quien lo cogía: Dile que baje.','2020-01-01 00:00:00'),(10,'La Pija y La Quinqui',NULL,'El podcast de Carlos Peguer y Mariang. Domingos a las 16:00h. Síguenos en redes en @pijayquinqui.','2020-01-01 00:00:00'),(11,'AM',NULL,'El resumen informativo de Kloshletter, dirigido por Charo Marcos, producido por Ricardo Villa y narrado por Eixchélt González y Jon Elicegui. Una producción de The Voice Village para Spotify.De lunes a viernes, a las 8:00 AM.','2019-01-01 00:00:00'),(12,'Levántate OK',NULL,'Levántate Ok, con toda la actualidad contada sin censuras. Música propia gracias a algunos de los mejores DJ\'s de Europa, mucho humor y crítica política despiadada.','2021-01-01 00:00:00'),(13,'Generación Futuro',NULL,'Este podcast no es un podcast, es un experimento. Un puente para que las ideas de los jóvenes dialoguen directamente con el Gobierno de España. ¿Por qué? El 85% de los jóvenes no se siente representado por ningún partido político, España es uno de los países con el mayor índice de trastornos mentales entre los jóvenes y el segundo con mayor desempleo de toda la Unión Europea. Por eso, hemos invitado a las mentes más lúcidas, tanto jóvenes activistas como pensadores de renombre, para charlar sobre discursos de odio, crisis climática, el impacto de la tecnología en nuestras vidas, los retos de la educación y del trabajo… y mucho más. Siempre de forma tranquila y humana. Conducido por Isaac Marcet, director de PlayGround, nos preguntaremos si es posible crear un espacio de diálogo entre los diferentes ministerios y la juventud para imaginar juntos el futuro. Si te interesa la política y sabemos que sí, escúchalo para averiguarlo.','2020-01-01 00:00:00'),(14,'Como si nadie escuchara',NULL,'En este programa yo (Cris Blanco) compartiré con vosotr@s todas mis ideas, opiniones, reflexiones, experiencias... y todo aquello que me pida el corazón! Sin filtros, como si nadie escuchara! Mi intención es acompañarte en tu día, entretenerte e inspirarte a ser la mejor versión de ti mism@, y que lo descubramos junt@s!','2019-01-01 00:00:00'),(15,'Saldremos mejores',NULL,'¿Acaso te conformas con cualquier cosa que te cuenten? Si tienes sed más allá de los ÚLTIMA HORA de Twitter, SALDREMOS MEJORES es tu espacio. Nosotras te contamos con gracia a dónde van tus impuestos, tus derechos como autónoma, para qué está la institución de la Corona en España o si la UE es justa con Murcia. No solo no te vas a dormir, sino que vas a espabilar. ¿Saldremos mejores? En este podcast, por lo menos, lo vamos a intentar.','2018-01-01 00:00:00'),(16,'Deforme semanal ideal total',NULL,'Deforme Semanal Ideal Total es el radioshow quincenal en el que Isa Calderón y Lucía Lijtmaer desgranan en Radio Primavera Sound su particular visión de la vida y la cultura contemporánea con risas, explicaciones redundantes y, en definitiva, todo aquello que necesitas saber en una hora entera sólo para ti. El podcast revelación en castellano de 2020 y uno de los más escuchados de España según Spotify.​','2017-01-01 00:00:00'),(17,'Club 133',NULL,'Club 113 es un podcast de Team Heretics presentado por Goorgo, Nil Ojeda y Werlyb. Obviamente, Team Heretics no se hace responsable de las opiniones vertidas por los invitados en el programa.','2018-01-01 00:00:00'),(18,'Maldito Bollodrama',NULL,'Maldito Bollodrama, el podcast definitivo de lesbianas hablando sobre lesbianas para lesbianas. Safo de Mitilene es nuestra pastora, nada nos falta.','2019-01-01 00:00:00'),(19,'El bar de los Broder Tolquin',NULL,'En 2010, la policia inició una investigación que acabaría con la desmantelación de una peligrosa banda criminal. Para ello se sirvió de micrófonos ocultos en un modesto bar de la capital. Casualmente ese tugurio es el mismo bar donde Javier Coronas, Raúl Cimas, El Pirata y un grupo de parroquianos muy variopinto pasaban las horas muertas. Todas las conversaciones fueron registradas llegando a acumular más de 43.000 horas en cintas de cassette de 90 minutos de Chrome Extra. Ahora, salen a la luz todas aquellas charlas que sobraron de la investigación... aunque sean años de conversaciones vacías.','2021-01-01 00:00:00'),(20,'Reyes del palique',NULL,'Desde su palacio (el salón de su casa) llegan los Reyes del Palique para hacer lo que más les mola: estar de cachondeo dando la chapa. Un podcast de Fizpireta y Uy Albert.','2018-01-01 00:00:00');
/*!40000 ALTER TABLE `podcast` ENABLE KEYS */;
UNLOCK TABLES;

